  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the National
  Bison Range outlines Refuge accomplishments for the 1981 calendar year. The report
  begins with an introduction to the Refuge and describes climate and habitat conditions.
  Refuge construction and maintenance are also described. Habitat management is covered;
  grasslands, wetlands, and croplands are discussed. The wildlife section of the report
  discusses migratory birds and mammals. Interpretation and recreation activities
  are outlined; topics include recreational uses and law enforcement. Items of interest
  and safety are discussed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
